let ct = 0;
function generatePDF(
    is2Inch,
    pipeQuantity,
    rate,
    partyName,
    address,
    quotationNum,
    GSTNum,
    sellingPrice
) {

    //Creating PDF
    ct+=1;
    console.log("Count = " + ct);
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    let year = new Date().getFullYear();
    let month = new Date().getMonth() + 1;
    if(month<=3) year-=1;

    console.log("INTO THE FUNCTION with " + is2Inch);

    // Function to add image (replace with actual image data if needed)
    function addFoxtailLogo(doc, x, y, width, height) {
        const logoBase64 = 'data:image/png;base64,';
        doc.addImage(logoBase64, 'PNG', x, y, width, height);
    }

    function addTable(doc,x,y,width,height){
        const logoBase64 = 'data:image/png;base64,';
        doc.addImage(logoBase64, 'PNG', x, y, width, height);
    }

    function addFooter(doc, x, y, width, height) {
        const logoBase64 = 'data:image/png;base64,';
        doc.addImage(logoBase64, 'PNG', x, y, width, height);
    }

    // Colors and Fonts
    const textColor = "#000000"; // Black
    const headingColor = "#000080"; // Dark Blue
    doc.setTextColor(textColor);
    doc.setFont("helvetica", "normal");

    // doc.text(is2Inch, 10, 10);
    // doc.text(partyName, 10, 20);
    // doc.text(address, 10, 30);
    // doc.text(GSTNum, 10, 40);
    // doc.text(quotationNum.toFixed(0), 10, 50);
    // doc.text(rate.toFixed(0), 10, 60);
    // doc.text(pipeQuantity.toFixed(0), 10, 70);
    // doc.text(sellingPrice.toFixed(0), 10, 80);

    // Page Header
    addFoxtailLogo(doc, 5, 5, 200, 70);
    

    // Quotation Details
    doc.setFont("helvetica", "bold");
    doc.setFontSize(10);
    doc.text(`Ref: F.V/${year%100}-${(year+1)%100}/HDPE/Q/${quotationNum}`, 15, 75);
    const currentDate = new Date().toLocaleDateString('en-GB').replace(/\//g, '.');
    doc.text(`Date: ${currentDate}`, 165, 75);

    // Customer Details
    doc.setFontSize(9);
    doc.text("To", 15, 85);
    doc.text(`CUSTOMER NAME: ${partyName}`, 15, 90);
    doc.text(`SHIPPING ADDRESS: ${address}`, 15, 95);
    doc.text(`GSTNO.: ${GSTNum}`, 15, 100);

    // Quotation Summary
    if(is2Inch)
    {
        doc.text("SUB.: QUOTATION FOR HDPE PIPE 63MM WITH FITTING", 15, 110);
    }
    else
    {
        doc.text("SUB.: QUOTATION FOR HDPE PIPE 80MM WITH FITTING", 15, 110);
    }

    // Greeting
    doc.setFontSize(9);
    doc.setFont("helvetica", "normal");
    doc.text("Dear Sir,", 15, 120);
    doc.text("We are very much pleased to submit our best rates:", 27, 125);

    //Table
    addTable(doc,15,136,180,40);

    // Table Content
    doc.setFont("courier", "bold");
    doc.setFontSize(11);
    if(is2Inch)
    {
        doc.text("63", 56, 148);
    }
    else
    {
        doc.text("80", 56, 148);
    }
    doc.setFontSize(10);
    let ratelen = rate.toFixed(2).length;
    let ratex = 123 - (ratelen-4);
    doc.text(`${rate.toFixed(2)}`, ratex, 148); // Price


    let pipeQuantitylen = pipeQuantity.toFixed(0).length;
    let pipeQuantityx = 148 - (pipeQuantitylen-4);
    doc.text(`${pipeQuantity.toFixed(0)}`, pipeQuantityx, 148); // Quantity
    
    let sellingPricelen = sellingPrice.toFixed(2).length;
    let sellingPricex = 175 - (sellingPricelen-4);
    console.log(sellingPricelen, sellingPricex);
    doc.text(`${sellingPrice.toFixed(2)}`, sellingPricex, 147.8); // Amount
    doc.text(`${sellingPrice.toFixed(2)}`, sellingPricex, 154.2); // total


    // Calculation
    const cgst = sellingPrice * 0.09;
    const sgst = sellingPrice * 0.09;
    const grandTotal = sellingPrice + cgst + sgst;
    let gstlen = cgst.toFixed(2).length;
    let gstx = 175 - (gstlen-4);
    doc.text(`${cgst.toFixed(2)}`, gstx, 160.6); // cgst
    doc.text(`${sgst.toFixed(2)}`, gstx, 167); // sgst
    doc.text(`${grandTotal.toFixed(2)}`, sellingPricex, 173.4); // grandTotal


    //OUTRO
    function numberToEnglish(n) {
        var string = n.toString(), units, tens, scales, chunks, chunksLen, chunk, ints, i, word, words, and = 'and';
    
        /* Remove spaces and commas */
        string = string.replace(/[, ]/g,"");
    
        /* Is number zero? */
        if (parseInt(string) === 0) {
            return 'zero';
        }
        
        /* Array of units as words */
        units = ['', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight', 'nine', 'ten', 'eleven', 'twelve', 'thirteen', 'fourteen', 'fifteen', 'sixteen', 'seventeen', 'eighteen', 'nineteen'];
        
        /* Array of tens as words */
        tens = ['', '', 'twenty', 'thirty', 'forty', 'fifty', 'sixty', 'seventy', 'eighty', 'ninety'];
        
        /* Array of scales as words */
        scales = ['', 'thousand', 'lakh', 'crore'];
        
        /* Split user argument into chunks from right to left */
        chunks = [];
        chunks.push(string.slice(-3)); // Extract last 3 digits
        string = string.slice(0, -3);
        while (string.length > 0) {
            chunks.push(string.slice(-2)); // Extract 2 digits
            string = string.slice(0, -2);
        }
        
        /* Check if function has enough scale words to be able to stringify the user argument */
        chunksLen = chunks.length;
        if (chunksLen > scales.length) {
            return '';
        }
        
        /* Stringify each integer in each chunk */
        words = [];
        for (i = 0; i < chunksLen; i++) {
            chunk = parseInt(chunks[i]);
            
            if (chunk) {
                /* Split chunk into array of individual integers */
                ints = chunks[i].split('').map(parseFloat);
                
                if (i == 0) { // This is for the rightmost 3 digits
                    /* Add tens and units */
                    if (ints[1] === 1) {
                        words.push(units[parseInt(chunks[i].slice(-2))]);
                    } else {
                        if (ints[2]) words.push(units[ints[2]]);
                        if (ints[1]) words.push(tens[ints[1]]);
                    }

                    /* Add hundreds word if array item exists */
                    if (ints[0]) {
                        if (ints[1] || ints[2]) words.push(and);
                        words.push('hundred')
                        words.push(units[ints[0]]); 
                    }
                } else { // This is for the other 2-digit chunks
                    if (scales[i]) {
                        words.push(scales[i]);
                    }
                    if (chunk < 20) {
                        words.push(units[chunk]);
                    } else {
                        if (ints[1]) words.push(units[ints[1]]);
                        words.push(tens[ints[0]]);
                        
                    }
                }
                
                /* Add scale word if chunk is not zero and array item exists */
            }
        }
        
        return words.reverse().join(' ');
    }
    

    let sum = Math.floor(grandTotal);
    let out = numberToEnglish(sum).toUpperCase();

    doc.setFont("helvetica", "bold");
    doc.setFontSize(9);
    let outlen = ("(INWORDS: RUPEES " + out + " ONLY)").length;
    let outx = 105 - (outlen);
    let greetlen = "We are looking for your valuable order.".length;
    let greetx = 114 - (greetlen);
    doc.text("(INWORDS: RUPEES " + out + " ONLY)", outx, 190);
    doc.text("We are looking for your valuable order.", greetx, 200);
    doc.text("Note: This quotation is valid for 10 days only.", 15, 220);
    
    //Footer in bottom right
    addFooter(doc,125,230,70,50);

    // Save PDF
    doc.save("quotation.pdf");
    location.reload();
}

